const { Deflate, Inflate } = require('fast-zlib')
const CACHE_BUFFER_SIGNATURE = '[tdc]';
(function(){
    const data = `[tdc]`
    const base64Data = data.substring(CACHE_BUFFER_SIGNATURE.length, data.length);
    const bufferData = Buffer.from(base64Data, 'base64');
    const inflate = new Inflate();
    const stringData = JSON.parse(inflate.process(bufferData).toString())
    console.log(" ~ file: inflate.js:9 ~ stringData:", stringData.find(value => value.publisherClient._id ='610cb93cccd0dd82d37b1b08').advertisers)
    console.log(" ~ file: inflate.js:9 ~ stringData length:", stringData.length)
})()